import React , {Component} from "react";

class GitTracker extends Component{
    render(){
        return(
            <div className="row">
                <div className="col-12">
                    <div>
                        <button>Git Tracker</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default GitTracker;
